import React from 'react';
import { services } from './Data';

import Navbar from '../components/Navbar';
import Footer from '../components/Footer';

import Button from 'react-bootstrap/Button';

import '../css/Pricing.scss';

import CircleCheck from '../img/pricing/check-circle.png';
import RightArrow from '../img/pricing/right-arrow.png';

const SignIn = () => {
	return (
		<div>
			<Navbar active="Pricing" />
			<div className="pricing">
				<Button className="eligibility-button" href="/eligibility">
					<p>
						Before you can purchase a legal package, please complete the
						eligibility quiz
					</p>
					<img
						src={RightArrow}
						alt="eligibility quiz"
						className="select-disable"
					/>
				</Button>
				<div>
					<h2>Legal Packages</h2>
					<p>Please select the package that best addresses your needs.</p>

					<div className="services">
						{services.map(({ shortName, description }) => (
							<div className="service">
								<h3>{shortName}</h3>
								<hr className="divider" />
								{description.map((point) => (
									<div className="point">
										<img src={CircleCheck} alt="Circle Check" />
										<p>{point}</p>
									</div>
								))}
								<Button className="learn-more">
									<p>Learn more</p>
								</Button>
							</div>
						))}
					</div>
				</div>
			</div>
			<Footer />
		</div>
	);
};

export default SignIn;
